import { FriendListItem } from '../FriendList/FriendListItem';

export const FriendList = ({friends}) => {
    return (
        <ul className='friend-list'>
            {friends.map(friend => {
                return (
                    <FriendListItem
                        key={friend.id}
                        avatar={friend.avatar}
                        name={friend.name}
                        isOnline={friend.isOnline}
                    />
                
                )
            })}
        </ul>    
        
    )   
}
